SELECT Platform, SUM(Impressions) AS Total_Impressions, SUM(Clicks) AS Total_Clicks, SUM(Conversions) AS Total_Conversions
FROM campaigns
GROUP BY Platform;

SELECT SUM(Spend) AS Total_Spend
FROM campaigns
WHERE Campaign_Name = 'Black Friday 2024';

SELECT Platform, COUNT(DISTINCT Campaign_Name) AS Number_of_Campaigns
FROM campaigns
GROUP BY Platform;

SELECT AVG(CPA) 
FROM campaigns 
WHERE Conversions > 1000;

SELECT SUM(Spend) AS Total_Spend
FROM campaigns
WHERE CAST(Date AS DATE) BETWEEN '2024-10-01' AND '2024-12-31';
